import React, { useState } from 'react';
import MenuIcon from '@mui/icons-material/Menu';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import IconButton from '@mui/material/IconButton';
import styles from './styles/DropdownMenu.module.css';

function DropdownMenu() {
  const [anchorEl, setAnchorEl] = useState(null);

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  return (
    <div className={styles.menu}>
      <IconButton onClick={handleClick} className={styles.menuButton}>
        <MenuIcon className={styles.menuIcon} />
      </IconButton>
      <Menu
        anchorEl={anchorEl}
        open={Boolean(anchorEl)}
        onClose={handleClose}
        PaperProps={{
          style: {
            maxHeight: 48 * 4.5,
            width: 'auto',
          },
        }}
      >
        <MenuItem onClick={handleClose} component="a" href="/organisations">Organisations</MenuItem>
        {/*<MenuItem onClick={handleClose} component="a" href="/create-organisation">Create Organisation</MenuItem>*/}
        {/* Add more menu items as needed */}
      </Menu>
    </div>
  );
}

export default DropdownMenu;
